import React, { Component } from 'react';
import { Container } from 'react-bootstrap';
import './final_project.css';

class Final_Project extends Component{
    render(){
        return (
            <div>
                <h1>OUR PROUD PROJECT</h1>
                <Container>
                    <div>
                        <p>SORT BY:</p>
                        <button>TIME</button>
                        <button>ALPHABETIC</button>
                    </div>
                    <div className="data">
                        
                    </div>
                </Container>
            </div>
        )
    }
}

export default Final_Project;
